import React, { Component } from 'react';
import './style.css';
import Counter from './counter';
// المصفوفه والتعامل معها في رياكت
class Counters extends Component {
    state = { 
        Counters:["Tag1" , "Tag2" , "Tag3" , "Tag4" , "Tag5"]
     }
     renderTags(){
        if(this.state.tags.length === 0) return <p className='ms_error'>this array empaty</p>
        return <ul className='list_test_one'> {this.state.tags.map(tag=><li>{tag}</li>)} </ul>
     }
    render() { 
        return (
            <React.Fragment>
                <Counter />
                <br></br>
                {this.state.tags.length === 0 && <p className='ms_error'>this array empaty</p>}
                {this.renderTags()}
            </React.Fragment>
        );
    }
}
 
export default Counters;
